import listVeiculos from "../../services/api";
import { useState } from "react";
import Card from "../../components/Card";

import "./index.css";

export default function Main() {
  const [carros, setCarros] = useState({});
  const [card, setCard] = useState([]);
  let arrayCard = [];

  listVeiculos.then((value) => setCarros(value));

  function handleCards() {
    for (let i = 0; i <= 6; i++) {
      arrayCard.push(
        <Card marca={carros.carros[i].marca} veiculo={carros.carros[i].veiculo} ano={carros.carros[i].ano} />
      );
    }
    setCard(arrayCard);
  }

  window.onload = () => handleCards

  return (
    <div className="container-main">
      <div className="container-section">
        <p className="title-section">Lista de ve√≠culos</p>
        <section id="lista-de-veiculos">{card}</section>
      </div>

      <div className="container-section">
        <p className="title-section">Detalhes</p>
        <section id="detalhes">Lorem Ipsum</section>
      </div>
    </div>
  );
}

